const SelectedUsers = ({selectedUsers}) => (
    <>
        <div>

               <h2>Selected Users:</h2>
                {selectedUsers.length > 0 ? (
                    <ul>
                        {selectedUsers.map(user => (
                            <li key={user.id}>
                                {user.name} ({user.username})
                            </li>
                        ))}
                    </ul>
                ) : (
                    <p>No users selected.</p>
                )}
        </div> 
    </>
);

export default SelectedUsers;
